import useSWR from 'swr'
import { fetcher } from '../utils'

const Home = () => {
  const { data, error } = useSWR('https://api.mysportsfeeds.com/v2.1/pull/nfl/2019-regular/week/1/games.json', fetcher)
  if (!data) {
    return null
  }
  console.log(data)
  return <h2>{`Hello ${data.name}`}</h2>
}

export default Home
